import React from 'react';
// import { useContext } from 'react';
import { Routes, Route, Navigate} from 'react-router-dom';
// import AuthContext from './store/auth-context';
import Signup from './components/Registration/SignUp';
import ForgetPass from './components/Forget/ForgetPass';
import HomePage from './pages/HomePage';
import SignIn from './components/Login/SignIn';
import CameraView from './components/Layout/Camera-view';
import RealtimeDisplay from './components/Layout/Real-time-Display';
import RecordAnalysis from './components/Layout/Record-analysis';
import Account from './components/Layout/Account';

function App() {
  // const authCtx = useContext(AuthContext);
  return (

      <Routes>

        <Route path="/" element={<SignIn />} /> 

        <Route path="/Signup" element={<Signup />} />
        <Route path="/Forget" element={<ForgetPass />} />

        <Route
        path="/Home/*"
        element={
          <HomePage>
            <Route index element={<ProfileForm />} />
            <Route path="camera" element={<CameraView />} />
            <Route path="real-time" element={<RealtimeDisplay />} />
            <Route path="record" element={<RecordAnalysis />} />
            <Route path="account" element={<Account />} />
          </HomePage>
        }
      />
        <Route path="/*" element={<Navigate to="/" />} />        


      </Routes>




  );
}

export default App;
